<?php

$debug = $argv[1] ?? false;

// https://www.hackerrank.com/challenges/sherlock-and-valid-string/problem?utm_campaign=challenge-recommendation&utm_medium=email&utm_source=24-hour-campaign

$method = 'isValid';

function isValid($s): string
{
    global $debug;

    $charCounts = array_count_values(str_split($s, 1));
    $totalCounts = array_count_values(array_values($charCounts));

    $debug && var_dump($charCounts, $totalCounts);

    if (count($totalCounts) == 1) {
        return 'YES';
    }

    if (count($totalCounts) > 1 && isset($totalCounts[1]) && $totalCounts[1] > 1) {
        return 'NO';
    }

    if (count($totalCounts) == 2 && isset($totalCounts[1]) && $totalCounts[1] == 1) {
        return 'YES';
    }

    $allEven = true;
    $oddCount = 0;
    $evenCount = 0;

    foreach ($charCounts as $letter => $charCount) {
        if ($charCount % 2 == 0) {
            $evenCount++;            
        } else {
            $allEven = false;
            $oddCount++;
        }
    }

    $debug && printf('All Even %s | oddCount %d | evenCount %d' . PHP_EOL, $allEven ? 'Y' : 'N', $oddCount, $evenCount);

    if ($oddCount == 1 && ! $allEven) {
        return 'YES';
    }

    if ($allEven && $evenCount > 1 && $oddCount <= 1) {
        return 'NO';
    }

    return $allEven ? 'YES' : 'NO';
}


$samples = [
    'abc' => 'YES',
    'aabbcd' => 'NO',
    'aabbccddeefghi' => 'NO',
    'abcdefghhgfedecba' => 'YES',
    'aaaabbcc' => 'NO',
    '' => 'YES',
    '' => 'NO',
    
];


foreach ($samples as $sample => $expected) {
    $result = $method($sample);
    $success = $result == $expected ? 'Y' : 'N';

    if (strlen($sample) > 100) {
        $sample = substr($sample, 0, 100) . '...';
    }

    echo sprintf('Success: %s | Expected: %s | Answer: %s | Sample: %s' . PHP_EOL, $success, $expected, $result, json_encode([ $sample => $expected]));
}